import React, { useState } from 'react'
import './App.css';
import ProductList from './components/ProductList';
export default function App() {
  const[product,setProduct]=useState()
  return (
    <div>
        <header id='bnr' ><img src='logo.png' id='imglogo'/><span id='logo'>La maison jungle</span></header>
        <div>
          <section>
            <div>
              <ProductList/>
            </div>
          </section>
        </div>
    </div>
  )
}
